module XMLex
# 1 "XMLex.fsl"
 
open FSharp.Text.Lexing
open XMPar

let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf

let keyword s =
    match s with
    | "char"    -> CHAR
    | "if"      -> IF
    | "else"    -> ELSE
    | "false"   -> CSTBOOL 0
    | "true"    -> CSTBOOL 1
    | "int"     -> INT
    | "null"    -> NULL 
    | "print"   -> PRINT
    | "println" -> PRINTLN 
    | "return"  -> RETURN 
    | "void"    -> VOID
    | "while"   -> WHILE
    | "double"  -> DOUBLE
    | "string"  -> STRING
    | _         -> NAME s

let cEscape s =
    match s with
    | "\\\\"    -> '\\'
    | "\\\""    -> '\"'
    | "\\a"     -> '\007'
    | "\\b"     -> '\008'
    | "\\t"     -> '\t'
    | "\\n"     -> '\n'
    | "\\v"     -> '\011'
    | "\\f"     -> '\012'
    | "\\r"     -> '\r'
    | _         -> failwith "Lexer error: impossible C escape" 

